Build a Rust program that calculates the sum of all even integers between two given numbers.  Create a function that takes the lower and upper limit as parameters and returns the sum of even numbers. Also, display formatting to get the most pleasing output.

# Solution 
```rust
fn even_numbers(lower_limit: i32, upper_limit: i32) -> i32 {
    let mut total: i32 = 0;

    for num in (lower_limit..upper_limit).rev(){
        if num % 2 == 0{
            total += num;
        }
    }
    total
}

 println!("{}",even_numbers(0,8));
``` 
